import React from 'react';
import './App.css';
import Header from './Header'
import Footer from './Footer'
import Item from './Item';
import todoData from './todoData'

function App() {
  const todoItems = todoData.map(item => <Item key={item.id} item={item}/>)
  return (
    <div className="App">
      <Header />
      <p></p>{todoItems}
      <Footer />
    </div>
  );
}

export default App;
